@Override
public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (!super.equals(obj)) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }

  RegexQuery other = (RegexQuery) obj;
  if (regexImpl == null) {
    if (other.regexImpl != null) {
      return false;
    }
  } else if (!regexImpl.equals(other.regexImpl)) {
    return false;
  }

  if (term == null) {
    if (other.term != null) {
      return false;
    }
  } else if (!term.equals(other.term)) {
    return false;
  }

  return true;
}

